import IntroSection from "./Components/General/IntroSection";
import Navbar from "./Components/UI/Navbar";
import RowContainer from "./Components/UI/RowContainer";
import TextSection from "./Components/General/TextSection";

function App() {
  return (
    <main>
      <IntroSection>
        <Navbar></Navbar>
        <RowContainer>
          <TextSection></TextSection>
        </RowContainer>
      </IntroSection>
    </main>
  );
}

export default App;
